import './FavoriteItems.css'
import axios from '../../Constants/axios'


function FavoriteItems() {
    useEffect(() => {
        axios.get('shop/view-favorite').then((response) => {
            console.log(response.data);
        })
    })
  return (
    <div>FavoriteItems</div>
  )
}

export default FavoriteItems
